import React from 'react';

function Food({name, picture}) {
  return (
    <div>
      <h2> I Like {name}</h2>
      <img src={picture} ></img>
    </div>
  )
}

const foodList = [
  {
    id : 1,
    name: 'Pasta',
    image : 'https://www.seriouseats.com/2019/08/20190809-burst-tomato-xo-pasta-vicky-wasik21-.jpg',
  },
  {
    id : 2,
    name: 'Meat',
    image: 'http://cdn.kormedi.com/wp-content/uploads/2020/03/gettyimages-a11229272.jpg',
  },
  {
    id : 3,
    name: '짜장면',
    image: 'https://i1.wp.com/sharehows.com/wp-content/uploads/2019/07/0-%EC%8D%B8%EB%84%A4%EC%9D%BC.jpg?resize=800%2C400',
  },
  {
    id : 4,
    name: '볶음밥',
    image: 'https://recipe1.ezmember.co.kr/cache/recipe/2016/09/08/97211dec5be68c09c36e600e08485e021.jpg',
  }
];


// function renderFood(dish) {
//   return <Food name={dish.name} picture={dish.image} />;
// }
//const renderFood = dish=> <Food name={dish.name} picture={dish.image} />;

function App() {
  return (
    <div>
      {foodList.map(x=> (<Food name={x.name} picture={x.image} />))}
    </div>
  ); 
}

export default App;
